import React, { useState, useEffect } from "react";

const Test2 = () => {
  const [divs, setDivs] = useState([]);
  const [rangeEnd, setRangeEnd] = useState(0);

  // Gdy zakres się zmienia, zaktualizuj divs
  useEffect(() => {
    const newDivs = Array.from({length: rangeEnd}, (_, i) => i + 1);
    setDivs(newDivs);
  }, [rangeEnd]);

  const handleInputChange = (e) => {
    setRangeEnd(Number(e.target.value));
  };

  return (
    <div>
      <input type="number" value={rangeEnd} onChange={handleInputChange} />
      {divs.map((num, i) => (
        <div key={i} style={{ height: "50px", width: "50px", backgroundColor: "lightblue", margin: "5px" }}>
          {num}
        </div>
      ))}
    </div>
  );
};
export default Test2;
